import React, { useState, useEffect } from 'react';
import {
  Container,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Typography,
  Button,
} from '@mui/material';
import { listarQuadras } from '../../services/api';
import { useNavigate } from 'react-router-dom';

const ListaQuadras = () => {
  const [quadras, setQuadras] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const buscarQuadras = async () => {
      try {
        const response = await listarQuadras();
        setQuadras(response);
      } catch (error) {
        console.error('Erro ao buscar quadras:', error);
      }
    };

    buscarQuadras();
  }, []);

  return (
    <Container maxWidth="md" sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom>
        Lista de Quadras
      </Typography>
      <Button
        variant="contained"
        color="primary"
        sx={{ mb: 2 }}
        onClick={() => navigate('/quadras/cadastro')}
      >
        Nova Quadra
      </Button>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Nome</TableCell>
              <TableCell>Tipo</TableCell>
              <TableCell>Localização</TableCell>
              <TableCell>Status</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {quadras.map((quadra) => (
              <TableRow key={quadra.id}>
                <TableCell>{quadra.nome}</TableCell>
                <TableCell>{quadra.tipo}</TableCell>
                <TableCell>{quadra.localizacao}</TableCell>
                <TableCell>
                  {quadra.disponivel ? 'Disponível' : 'Indisponível'}
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Container>
  );
};

export default ListaQuadras;
